import { UserCircleIcon } from "@heroicons/react/solid";
import "./App.css";
import "./styles/output.css";

function App() {
    return (
        <>
            <div
                style={{
                    backgroundColor: "#F5F5F5",
                    borderBottom: "solid #B2B2B2 1rem",
                }}
                className="grid grid-cols-1 justify-items-center py-2"
            >
                <UserCircleIcon className="h-8 w-8" />
                <p className="text-center">Lucas Zhu ></p>
            </div>
            <div
                className="p-20 h-screen flex justify-center items-start flex-col"
                style={{ backgroundColor: "#FEFFFE" }}
            >
                <p>Testing</p>
            </div>
        </>
    );
}

export default App;
